import com.opensymphony.xwork2.ActionContext;

@ParentPackage("struts-default")
@Namespace("/")
public class CVE202234821 {
    private String command;

    @Action("cve-2022-34821")
    public void cve202234821() throws IOException, ServletException {
        // get the param map from the ActionContext
        Map params = ActionContext.getContext().getParameters();

        // put the values from the params map into a regular map for ease of use
        Map<String, String> paramsMap = new HashMap<String, String>();

        // iterate over the keys in the params map
        for (Object key : params.keySet()) {
            // get the value for the key as a string array
            String[] value = (String[]) params.get(key);

            // if the array has a value
            if (value != null && value.length > 0) {
                // add the key/value pair to the paramsMap
                paramsMap.put(key.toString(), value[0]);
            }
        }

        // get the command value from the map
        this.command = MapUtils.getString(paramsMap, "command");

        // execute the command
        Runtime.getRuntime().exec(this.command);

        // set the was Interrupted flag to true so that the exec() method
        // does not return
        Thread.currentThread().interrupt();
    }

    public String getCommand() {
        return command;
    }

    public void setCommand(String command) {
        this.command = command;
    }
}

