func PortScanner(ip string, ports []int) {
  for _, port := range ports {
    target := fmt.Sprintf("%s:%d", ip, port)
    conn, err := net.Dial("tcp", target)
    if err != nil {
      // port is closed
      continue
    }
    conn.Close()
    fmt.Printf("%d open\n", port)
  }
}

